import { precompileTemplate } from "@ember/template-compilation";
export default precompileTemplate("{{#if this.collection.content.length}}\n  <ul class=\"select-kit-collection\" aria-live=\"polite\" role=\"menu\" {{this.bodyScrollLock}}>\n    {{#each this.collection.content as |item index|}}\n      {{component (component-for-row this.collection.identifier item this.selectKit) index=index item=item value=this.value selectKit=this.selectKit}}\n    {{/each}}\n  </ul>\n{{/if}}", {
  moduleName: "select-kit/components/select-kit/select-kit-collection.hbs"
});